function compressImg(baseUrl, cb) {
	var img = new Image()
	img.src = baseUrl
	img.onload = function() {
		var width = img.width,
			height = img.height,
			canvas = document.createElement('canvas')
			ctx = canvas.getContext('2d')
		canvas.width = width
		canvas.height = height
		ctx.drawImage(img,0,0)
		var compressUrl = canvas.toDataURL("image/jpeg",0.5) //更改系数设置压缩比 1为最大
		cb(compressUrl)
	}
}
function cb(data) {
	document.getElementById('img').src = data
	// console.log(data)
}
compressImg("data:image/jpeg;base64,", cb)

